<!-- ko if: (isModuleEnabled()) -->\n<div class=\"shipping-delivery-date\">\n    <!-- ko if: (getDeliveryDate()) -->\n    <!-- ko i18n: 'Delivery Date'--><!-- /ko -->: <span class=\"value\" data-bind=\"text: getDeliveryDate()\"></span><br/>\n    <!--/ko-->\n    <!-- ko if: (getDeliveryTime()) -->\n    <!-- ko i18n: 'Delivery Time'--><!-- /ko -->: <span class=\"value\" data-bind=\"text: getDeliveryTime()\"></span><br/>\n    <!--/ko-->\n    <!-- ko if: (getDeliveryComment()) -->\n    <!-- ko i18n: 'Delivery Comment'--><!-- /ko -->: <span class=\"value\" data-bind=\"text: getDeliveryComment()\"></span><br/>\n    <!--/ko-->\n</div>\n<!--/ko-->\n","Amasty_Deliverydate/template/form/element/date.html":"<input class=\"input-text\" type=\"text\" data-bind=\"\n    hasFocus: focused,\n    valueUpdate: valueUpdate,\n    attr: {\n        value: shiftedValue,\n        name: inputName,\n        placeholder: placeholder,\n        'aria-describedby': noticeId,\n        disabled: disabled,\n        id: uid,\n        readonly: true\n    },\n    amastydatepicker: { storage: shiftedValue, options: options, elem: getElem() }\" />\n","Amasty_Deliverydate/template/form/element/select.html":"<select class=\"select\" data-bind=\"\n    attr: {\n        name: inputName,\n        id: uid,\n        disabled: disabled,\n        'aria-describedby': noticeId,\n        placeholder: placeholder\n    },\n    hasFocus: focused,\n    options: options,\n    value: value,\n    optionsCaption: caption,\n    optionsValue: 'value',\n    optionsText: 'label',\n    optionsAfterRender: function(option, item) {\n        if (item && item.disabled) {\n            ko.applyBindingsToNode(option, {attr: {disabled: true}}, item);\n        }\n    }\"\n/>\n","Magento_Vault/template/payment/form.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div class=\"payment-method\" css=\"'_active': (getId() === isChecked())\">\n    <div class=\"payment-method-title field choice\">\n        <input type=\"radio\"\n               name=\"payment[method]\"\n               class=\"radio\"\n               data-bind=\"\n                    attr: {'id': getId()},\n                    value: getId(),\n                    click: selectPaymentMethod,\n                    checked: isChecked,\n                    visible: isRadioButtonVisible()\"/>\n        <label class=\"label\" data-bind=\"attr: {'for': getId()}\">\n            <img data-bind=\"attr: {\n            'src': getIcons(getCardType()).url,\n            'width': getIcons(getCardType()).width,\n            'height': getIcons(getCardType()).height,\n            'alt': getIcons(getCardType()).title\n            }\" class=\"payment-icon\">\n            <span translate=\"'ending'\"></span>\n            <span text=\"getMaskedCard()\"></span>\n            (\n            <span translate=\"'expires'\"></span>:\n            <span text=\"getExpirationDate()\"></span>\n            )\n        </label>\n    </div>\n\n    <div class=\"payment-method-content\">\n        <each args=\"getRegion('messages')\" render=\"\"></each>\n        <div class=\"payment-method-billing-address\">\n            <each args=\"data: $parent.getRegion(getBillingAddressFormName()), as: '$item'\">\n                <render args=\"$item.getTemplate()\"/>\n            </each>\n        </div>\n        <div class=\"checkout-agreements-block\">\n            <!-- ko foreach: $parent.getRegion('before-place-order') -->\n            <!-- ko template: getTemplate() --><!-- /ko -->\n            <!--/ko-->\n        </div>\n        <div class=\"actions-toolbar\">\n            <div class=\"primary\">\n                <button class=\"action primary checkout\"\n                        type=\"submit\"\n                        data-bind=\"\n                            click: placeOrder,\n                            attr: {title: $t('Place Order')},\n                            enable: isButtonActive()\n                        \"\n                    disabled>\n                    <span translate=\"'Place Order'\"></span>\n                </button>\n            </div>\n        </div>\n    </div>\n</div>\n","Netweb_Pdfinvoiceplus/template/printQuote.html":"<div class=\"actions\">\n    <div class=\"primary\" data-bind=\"visible: displayButton\" >\n        <button\n                id=\"top-cart-btn-print-quote\"\n                type=\"button\"\n                class=\"action primary\"\n                data-bind=\"click: printQuote, attr: {title: $t('Print quote')}\">\n            Print quote\n        </button>\n    </div>\n</div>\n<style>\n    .minicart-items-wrapper {\n        height:100% !important;\n    }\n</style>","Magento_Payment/template/payment/iframe.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<!-- IFRAME for request to Payment Gateway -->\n<iframe width=\"0\" height=\"0\" data-bind=\"src: getSource(), attr: {id: getCode() + '-transparent-iframe', 'data-container': getCode() + '-transparent-iframe'}\" allowtransparency=\"true\" frameborder=\"0\"  name=\"iframeTransparent\" style=\"display:none;width:100%;background-color:transparent\"></iframe>\n<form class=\"form\" id=\"co-transparent-form\" autocomplete=\"off\" action=\"#\" method=\"post\" data-bind=\"mageInit: {\n    'transparent':{\n        'controller': getControllerName(),\n        'gateway': getCode(),\n        'orderSaveUrl':getPlaceOrderUrl(),\n        'cgiUrl': getCgiUrl(),\n        'dateDelim': getDateDelim(),\n        'cardFieldsMap': getCardFieldsMap(),\n        'nativeAction': getSaveOrderUrl(),\n        'expireYearLength': getExpireYearLength()\n    }, 'validation':[]}\">\n<!-- ko with: getCcFormView() -->\n    <!-- ko template: getTemplate() --><!-- /ko -->\n<!-- /ko -->\n</form>\n<div class=\"checkout-agreements-block\">\n    <!-- ko foreach: $parent.getRegion('before-place-order') -->\n        <!-- ko template: getTemplate() --><!-- /ko -->\n    <!--/ko-->\n</div>\n<div class=\"actions-toolbar\" id=\"review-buttons-container\">\n    <div class=\"primary\">\n        <button data-role=\"review-save\" type=\"submit\"\n                data-bind=\"attr: {title: $t('Place Order')}\"\n                class=\"button action primary checkout\">\n            <span data-bind=\"i18n: 'Place Order'\"></span>\n        </button>\n        <button type=\"submit\" id=\"originalPlaceOrder\" class=\"hidden\"\n                data-bind=\"click: originalPlaceOrder($parents[1])\"></button>\n    </div>\n    <div class=\"secondary\">\n        <span id=\"checkout-review-edit-label\" data-bind=\"i18n: 'Forgot an Item?'\"></span>\n        <a data-bind=\"attr: {href: $parents[1].cartUrl}\"\n           aria-describedby=\"checkout-review-edit-label\"\n           class=\"action edit\">\n            <span data-bind=\"i18n: 'Edit Your Cart'\"></span>\n        </a>\n    </div>\n</div>\n","Magento_Payment/template/payment/free.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div class=\"payment-method\" data-bind=\"css: {'_active': (getCode() == isChecked())}, visible: isAvailable()\">\n    <div class=\"payment-method-title field choice\">\n        <input type=\"radio\"\n               name=\"payment[method]\"\n               class=\"radio\"\n               data-bind=\"attr: {'id': getCode()}, value: getCode(), checked: isChecked, click: selectPaymentMethod, visible: isRadioButtonVisible()\"/>\n        <label data-bind=\"attr: {'for': getCode()}\" class=\"label\"><span data-bind=\"text: getTitle()\"></span></label>\n    </div>\n    <div class=\"payment-method-content\">\n        <!-- ko foreach: getRegion('messages') -->\n        <!-- ko template: getTemplate() --><!-- /ko -->\n        <!--/ko-->\n        <div class=\"payment-method-billing-address\">\n            <!-- ko foreach: $parent.getRegion(getBillingAddressFormName()) -->\n            <!-- ko template: getTemplate() --><!-- /ko -->\n            <!--/ko-->\n        </div>\n        <div class=\"checkout-agreements-block\">\n            <!-- ko foreach: $parent.getRegion('before-place-order') -->\n                <!-- ko template: getTemplate() --><!-- /ko -->\n            <!--/ko-->\n        </div>\n        <div class=\"actions-toolbar\">\n            <div class=\"primary\">\n                <button class=\"action primary checkout\"\n                        type=\"submit\"\n                        data-bind=\"\n                        click: placeOrder,\n                        attr: {title: $t('Place Order')},\n                        css: {disabled: !isPlaceOrderActionAllowed()}\n                        \">\n                    <span data-bind=\"i18n: 'Place Order'\"></span>\n                </button>\n            </div>\n        </div>\n    </div>\n</div>\n","Magento_Payment/template/payment/cc-form.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n\n<fieldset data-bind=\"attr: {class: 'fieldset payment items ccard ' + getCode(), id: 'payment_form_' + getCode()}\">\n    <!-- ko if: (isShowLegend())-->\n    <legend class=\"legend\">\n        <span><!-- ko i18n: 'Credit Card Information'--><!-- /ko --></span>\n    </legend><br />\n    <!-- /ko -->\n    <div class=\"field type\">\n        <div class=\"control\">\n            <ul class=\"credit-card-types\">\n                <!-- ko foreach: {data: getCcAvailableTypesValues(), as: 'item'} -->\n                <li class=\"item\" data-bind=\"css: {\n                                                 _active: $parent.selectedCardType() == item.value,\n                                                 _inactive: $parent.selectedCardType() != null && $parent.selectedCardType() != item.value\n                                                 } \">\n                    <!--ko if: $parent.getIcons(item.value) -->\n                    <img data-bind=\"attr: {\n                        'src': $parent.getIcons(item.value).url,\n                        'alt': item.type,\n                        'width': $parent.getIcons(item.value).width,\n                        'height': $parent.getIcons(item.value).height\n                        }\">\n                    <!--/ko-->\n                </li>\n                <!--/ko-->\n            </ul>\n            <input type=\"hidden\"\n                   name=\"payment[cc_type]\"\n                   class=\"input-text\"\n                   value=\"\"\n                   data-bind=\"attr: {id: getCode() + '_cc_type', 'data-container': getCode() + '-cc-type'},\n                   value: creditCardType\n                   \">\n        </div>\n    </div>\n    <div class=\"field number required\">\n        <label data-bind=\"attr: {for: getCode() + '_cc_number'}\" class=\"label\">\n            <span><!-- ko i18n: 'Credit Card Number'--><!-- /ko --></span>\n        </label>\n        <div class=\"control\">\n            <input type=\"number\" name=\"payment[cc_number]\" class=\"input-text\" value=\"\"\n                   data-bind=\"attr: {\n                                    autocomplete: off,\n                                    id: getCode() + '_cc_number',\n                                    title: $t('Credit Card Number'),\n                                    'data-container': getCode() + '-cc-number',\n                                    'data-validate': JSON.stringify({'required-number':true, 'validate-card-type':getCcAvailableTypesValues(), 'validate-card-number':'#' + getCode() + '_cc_type', 'validate-cc-type':'#' + getCode() + '_cc_type'})},\n                              enable: isActive($parents),\n                              value: creditCardNumber,\n                              valueUpdate: 'keyup' \"/>\n        </div>\n    </div>\n    <div class=\"field date required\" data-bind=\"attr: {id: getCode() + '_cc_type_exp_div'}\">\n        <label data-bind=\"attr: {for: getCode() + '_expiration'}\" class=\"label\">\n            <span><!-- ko i18n: 'Expiration Date'--><!-- /ko --></span>\n        </label>\n        <div class=\"control\">\n            <div class=\"fields group group-2\">\n                <div class=\"field no-label month\">\n                    <div class=\"control\">\n                        <select  name=\"payment[cc_exp_month]\"\n                                 class=\"select select-month\"\n                                 data-bind=\"attr: {id: getCode() + '_expiration', 'data-container': getCode() + '-cc-month', 'data-validate': JSON.stringify({required:true, 'validate-cc-exp':'#' + getCode() + '_expiration_yr'})},\n                                            enable: isActive($parents),\n                                            options: getCcMonthsValues(),\n                                            optionsValue: 'value',\n                                            optionsText: 'month',\n                                            optionsCaption: $t('Month'),\n                                            value: creditCardExpMonth\">\n                        </select>\n                    </div>\n                </div>\n                <div class=\"field no-label year\">\n                    <div class=\"control\">\n                        <select name=\"payment[cc_exp_year]\"\n                                class=\"select select-year\"\n                                data-bind=\"attr: {id: getCode() + '_expiration_yr', 'data-container': getCode() + '-cc-year', 'data-validate': JSON.stringify({required:true})},\n                                           enable: isActive($parents),\n                                           options: getCcYearsValues(),\n                                           optionsValue: 'value',\n                                           optionsText: 'year',\n                                           optionsCaption: $t('Year'),\n                                           value: creditCardExpYear\">\n                        </select>\n                    </div>\n                </div>\n            </div>\n        </div>\n    </div>\n    <!-- ko if: (hasVerification())-->\n    <div class=\"field cvv required\" data-bind=\"attr: {id: getCode() + '_cc_type_cvv_div'}\">\n        <label data-bind=\"attr: {for: getCode() + '_cc_cid'}\" class=\"label\">\n            <span><!-- ko i18n: 'Card Verification Number'--><!-- /ko --></span>\n        </label>\n        <div class=\"control _with-tooltip\">\n            <input type=\"number\"\n                   autocomplete=\"off\"\n                   class=\"input-text cvv\"\n                   name=\"payment[cc_cid]\"\n                   value=\"\"\n                   data-bind=\"attr: {id: getCode() + '_cc_cid',\n                        title: $t('Card Verification Number'),\n                        'data-container': getCode() + '-cc-cvv',\n                        'data-validate': JSON.stringify({'required-number':true, 'validate-card-cvv':'#' + getCode() + '_cc_type'})},\n                        enable: isActive($parents),\n                        value: creditCardVerificationNumber\" />\n            <div class=\"field-tooltip toggle\">\n                <span class=\"field-tooltip-action action-cvv\"\n                      tabindex=\"0\"\n                      data-toggle=\"dropdown\"\n                      data-bind=\"attr: {title: $t('What is this?')}, mageInit: {'dropdown':{'activeClass': '_active'}}\">\n                    <span><!-- ko i18n: 'What is this?'--><!-- /ko --></span>\n                </span>\n                <div class=\"field-tooltip-content\"\n                     data-target=\"dropdown\"\n                     data-bind=\"html: getCvvImageHtml()\"></div>\n            </div>\n        </div>\n    </div>\n    <!-- /ko -->\n</fieldset>\n"}
